import React, { useState } from 'react'
import './Calendar.sass'

function Calendar() {
    const [date, setDate] = useState(new Date)

    enum Months {
        January = 'January',
        February = 'February',
        March = 'March',
        April = 'April',
        May = 'May',
        June = 'June',
        July = 'July',
        August = 'August',
        September = 'September',
        October = 'October',
        November = 'November',
        December = 'December'
    }

    const CheckMonth = (month: number): string => {
        switch (month) {
            case 0:
                return Months.January;
                break;
        }
    }
    return (
        <div className='calendar'>
            <p className='calendar-day'>{date.getDate()}</p>
            <p className='calendar-month'>{date.getMonth()}</p>
        </div>
    )
}

export default Calendar
